notes:
- 'NOTE: The plugin must be registered using `register_plugin` with name `heap` in
  order to function properly.'
- This heap implementation is a holdover from before any more proper implementations
  were modelled.
- Heap implementations are expected to override these functions regardless of whether
  they implement the SimHeapLibc interface.
- The plugin must be registered using `register_plugin` with name `heap` in order
  to function properly.
- Widening is a special kind of merging that produces a more general state from several
  more specific states.
- The pos argument to the read and write methods will be ignored, and will return
  None.
- This class will NOT respect the position argument you pass it - this storage is
  not stateless.
- Uses OAuth2 with refresh token  requires setup of connected app in SimMemory
- Some objects like MemoryView may return nulls in deeply nested fields
- Uses memory management techniques for static analysis.
- Set SUPPORTS_CONCRETE_LOAD to True and implement concrete_load if reading concrete
  bytes is faster in this memory model.
- Uses OAuth2 with refresh token  requires setup of connected app in api
- Some objects like Contact may return nulls in deeply nested fields
- Uses a mixin architecture for memory management.
- AbstractAddressDescriptor provides a way to access memory addresses.
- This mixin adds automatic allocation for a stack region based on the stack_end and
  stack_size parameters.
- Simulation managers allow you to wrangle multiple states in a slick way.
- States are organized into 'stashes', which you can step forward, filter, merge,
  and move around as you wish.
- Lifts machine code in data to a P-code IRSB.
- Default CC for RISCV
- Some parameters may require special handling based on architecture
- Default CC for Xtensa
- A class to keep track of the state accumulated in laying parameters out into memory
- The setup_callsite function performs the actions of the caller getting ready to
  jump into a function.
- The teardown_callsite function performs the actions of the callee as its getting
  ready to return.
- Callee cleanup is set to True
- The return value location is stored in eax
- Uses various calling conventions for different architectures.
- The default behavior is that there are a finite list of int-only and fp-only argument
  slots.
- The data dependence graph can be either CFG-based, or Value-set analysis based.
- A CFG-based DDG is much faster to generate, but it is neither sound nor accurate.
- This class provides the control interface necessary to describe how integral and
  floating-point arguments are laid out into memory.
- Provides a disassembly object using whatever disassembler is available
- Some objects may return nulls in deeply nested fields
- load will throw a TypeError if no size is provided
- store will default to len(data)//byte_width if no size is provided
- Compatibility methods available for enabling/disabling Boolean switches.
- Merge conditions can be None, in which case use state.solver.union(values).
- Uses a stash system to manage states during simulation.
- Uses angr library for symbolic execution and analysis.
- The class keeps track of the state accumulated in laying parameters out into memory.
- This API provides various calling conventions for different architectures.
- This function performs the actions of the caller getting ready to jump into a function.
- Default CC for PARISC
- Default CC for PowerPC
- The `get_xrefs_by_ins_addr_region` method is useful for finding references from
  a basic block or function.
- The `serialize_to_cmessage` method returns a protobuf cmessage object.
- Uses SimState to operate on
- Support for stack_base parameter from setup_callsite
- CFG is just a wrapper around CFGFast for compatibility issues
- CFG will be an alias to CFGFast instead of CFGEmulated
- Uses Python types to be translated to binary format
- Lists must have elements of the same type and size
- Returns a CFG instance which is a sub-graph of self.graph
- Get all CFGNodes that has an out-degree of 0
- Some methods may return None if no data is available.
- Describes an incomplete set of switch-case nodes. Usually an intermediate result.
  Should always be restructured into a SwitchCaseNode by the end of structuring. Only
  used in Phoenix structurer.
- Implements several different arithmetic optimizations.
- Simplifies optimized forms of modulo computation back to 'mod'.
- SyncController interfaces with a binsync client to push changes upwards and pull
  changes downwards.
- Aliasing is definitely a problem, and I forgot how aliasing is resolved in this
  implementation. Ill leave this as a post-graduation TODO.
- Some more documentation and examples would be nice.
- Normalization of CFG ensures no overlapping basic blocks.
- Function alignments may be incorrectly marked due to unresolved indirect jumps.
- The reassembler is an empirical solution. Dont be surprised if it does not work
  on some binaries.
- This API does not currently support syscalls.
- Exception handling is performed when SimException is thrown.
- Simplifies various division optimizations back to 'div'.
- Transform specific expressions into If-Then-Else expressions, or tertiary expressions
  in C.
- Only works when the Phoenix structuring algorithm is in use.
- PropagatorAnalysis supports both VEX and AIL.
- Some parameters may be optional and can take None as a value.
- Each definition is memoized to avoid any kind of recomputation across the lifetime
  of this object.
- This algorithm has exponential time and space complexity. Use at your own risk.
- If redefine_locals is unset, do not adjust any artifacts of the function call abstraction,
  such as the stack pointer, the caller saved registers, etc.
- If caller_will_handle_single_ret is set, and there is a single entry in ret_atoms,
  do not apply to the state effects modifying this atom.
- angr uses the standard logging module for logging, with every package and submodule
  creating a new logger.
- The simplest way to get debug output is to set logging level to DEBUG.
- The ordering of variables is undefined if A -> B and B -> A.
- By default, angr will enable logging at the WARNING level.
